import React from "react";
import { View, Image, Text } from "react-native";
import { RectButton } from "react-native-gesture-handler";

import heartOutlineIcon from "../../assets/images/icons/heart-outline.png";
import unfavoriteIcon from "../../assets/images/icons/unfavorite.png";
import wahtsappIcon from "../../assets/images/icons/whatsapp.png";

import styles from "./styles";

function TeacherItem() {
  return (
    <View style={styles.container}>
      <View style={styles.profile}>
        <Image
          style={styles.avatar}
          source={{ uri: "https://github.com/wesandrade.png" }}
        />

        <View style={styles.profileInfo}>
          <Text style={styles.name}>Wesley Andrade</Text>
          <Text style={styles.subject}>Física</Text>
        </View>
      </View>

      <Text style={styles.bio}>
        Mussum Ipsum, cacilds vidis litro abertis. Detraxit consequat et quo num
        tendi nada.
        {"\n"}
        {"\n"}
        Cevadis im ampola pa arma uma pindureta. Quem num gosta di mé, boa
        gentis num é. Mé faiz elementum girarzis, nisi eros vermeio.
      </Text>

      <View style={styles.footer}>

        {/* Preço/Hora */}
        <Text style={styles.price}>
          Preço/Hora {"   "}
          <Text style={styles.priceValue}>R$ 70,00</Text>
        </Text>

        {/* Favorito */}
        <View style={styles.buttonsContainer}>
          <RectButton style={[styles.favoriteButton, styles.favorited]}>
            {/* <Image source={heartOutlineIcon} /> */}
            <Image source={unfavoriteIcon} />
          </RectButton>

          {/* Wahtsapp */}
          <RectButton style={styles.contactButton}>
            <Image source={wahtsappIcon} />
            <Text style={styles.contactButtonText}>Entrar em contato</Text>
          </RectButton>
        </View>
      </View>
    </View>
  );
}

export default TeacherItem;
